// IsWhiteSpaceNo reports whether the rune has property "White_Space"="No".
// Property "White_Space" known as "WSpace", "White_Space", "space".
// Value "No" known as "N", "No", "F", "False".
func IsWhiteSpaceNo(r rune) bool {
	const lo = 0x9
	const hi = 0x3000
	if r < lo || r > hi {
		return true
	}
	var i = (r - lo) / 64
	var shift = (r - lo) % 64
	return dataArrayIsWhiteSpaceNo[i]&(1<<uint(shift)) != 0
}

